import './App.css';
import Menu from "./components/Menu/Menu";
import {useEffect, useState} from "react";
import {getCommands} from "./dataAccess";



function App() {
  const [commands, setCommands] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const retrievedCommands = await getCommands();
        setCommands(retrievedCommands);
      } catch (error) {
        console.error('Error fetching commands:', error);
      }
    };
    fetchData();
  }, []);

  return (
    <div className="App">
      <Menu commands={commands} />
    </div>
  );
}

export default App;
